INSERT INTO `HomePage` VALUES (1,'Committed to giving you the comfort you need','<p>We pursue to accommodate the needs of comercial and industrial buildings and enable them to achieve the comfort level they need.</p>','test','LEARN MORE','ABOUT US','Who We Are','<p><!--(figmeta)eyJmaWxlS2V5IjoiUVZaU0gzZ0l3VHJvbHNGdFNRQnNSRiIsInBhc3RlSUQiOjE2NzUwMDQ4MjIsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)--><span>Thermal Solutions, Inc. (TSI) is an Air-Conditioning and Energy Service Company advocating <br>Green Buildings by integrating energy and power, covering portfolio of energy <br>efficiency, comfort, renewable energy and power quality solutions.</span></p>','test','KNOW MORE','EXPERTISE & ACHIEVEMENTS','Projects','<p><span>TSI has a wide range of services that they\'ve mastered. Proof of this would be our long list of achievements, accreditations and satisfied clients. See all of them and find out how capable we are.</span></p>','tesst','EXPLORE','PRODUCTS & SERVICES','What We Can Do','<p><span>Through our seasoned professionals coupled with the most advanced technology, we, at TSI are pursuing to accommodate the needs of commercial and industrial buildings enable them to achieve the comfort level they need.</span></p>','test','SEE ALL','CAREERS','We\'re Hiring','<p>Be part of the first class A Energy Service Company (ESCO) accredited by the Department of Energy by joining us today. There are multiple openings waiting for you today.</p>','test','SEE ALL','CONTACT US','Get in touch','5th Floor, Sycamore ARCS 1 Bldg., Buencamino St., Alabang-Zapote Rd., Muntinlupa City','+63 2 809 3916','+63 2 771 0541','+63 2 771 0542','+63 2 771 0378','info@thermalsolinc.com',34,0,0,0,63,73,81);
