INSERT INTO `ProductsAndServicesHolder` VALUES (9,'<p>Thermal Solutions, Inc. (TSI) is an Air-Conditioning and Energy Service Company advocating Green Buildings by integrating energy and power, covering portfolio of energy efficiency, comfort, renewable energy and power quality solutions.</p><p>&nbsp;</p><p>TSI has started as a trading and services company which primarily engaged in repairs, operatorship, general maintenance, parts sales and installation of HVAC equipments such as chillers, cooling towers, air handling units, etc. We also offer retrofitting services which helps various buildings improve their plant and systems performance.</p><p>&nbsp;</p><p>Through our seasoned professionals coupled with the most advanced technology, we, at TSI are pursuing to accommodate the needs of commercial and industrial buildings enable them to achieve the comfort level they need.</p>');
